import React from 'react';


const Orderview=(props)=>{

console.log(props)

    console.log(props)
    const renderTable=({orderdata})=>{
        if(orderdata){
        return orderdata.map((item)=>{
            //console.log(item)
            return(
                <tr>

                    <td>{item._id}</td>
                    <td>{item.name}</td>


                    <td>{item.email}</td>
                    <td>{item.address}</td>
                    <td>{item.rest_id}</td>
                    <td>{item.quantity}</td>

                </tr>
            )
         })
        }
    }
    return(
        <div>
            <center><h3>order list</h3></center>
            <table className="table" >
                <thead>
                    <tr>
                    <th>order_id</th>

                    <th>name</th>
                    <th>email</th>
                    <th>address</th>
                    <th>rest_id</th>
                    <th>quantity</th>

                    </tr>
                </thead>

             <tbody>
             {renderTable(props)}
             </tbody>

            </table>
        </div>
    )
}

export default Orderview;
